        </div>
        <div className="title">
          <h1>Mrs. Uma Ade</h1>
        </div>
        <div className="body">
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam</p>
        </div>
        <div className="footer">
          <button
            onClick={() => {
              setOpenModal(false);
            }}
          >
            Previous
          </button>
          <button>Next</button>
        </div>
      </div>
    </div>
  );
}

export default Modal;
